import React from "react";
import { useSelector } from "react-redux";

const Navbar = () => {
  const user = useSelector((state: any) => state.user);
  return (
    <div className="w-full h-[50px] flex flex-row-reverse border">
      Hello, {user.username}
    </div>
  );
};

export default Navbar;
